import './App.css';
import { Container, Row, Col, Button } from 'reactstrap';

const App = (props) => {
  return (
    <Container>
      <Row>
        <Col>
          <Button color="success">+</Button>
        </Col>
      </Row>
    </Container>
  );
}

export default App;
